	<span style="background-color:#FFFFFF;font-family:宋体;">【我们杯具了！】---关于东方</span>
</h2>
<h2 style="font-family:sans-serif;margin-left:0px;">
	<span style="background-color:#FFFFFF;font-family:宋体;">主营:保温杯、陶瓷杯、玻璃杯的批发、团购、定制！</span>
</h2>
<p style="font-family:sans-serif;font-size:16px;text-indent:32px;">
	<span style="font-family:宋体;">经过近一年时间与上游生产厂家的接触与洽谈，我们先后取得玻璃杯品牌“意德丽塔”的诸暨经销权，拿到了陶瓷品牌</span>-<span style="font-family:宋体;">中国驰名商标“怀泉”在诸暨的经销权，并且与英国</span>.<span style="font-family:宋体;">品牌“</span>BEMEGA<span style="font-family:宋体;">”保温杯签下了绍兴独家总代理权，负责整个绍兴地区的运营推广及批发零售业务。</span><span style="font-family:宋体;"><img src="https://mmbiz.qlogo.cn/mmbiz/gr7NDcVyoDHnb4tgsKDDmiaicK2bH3icziaQsoYwQESXhqvOzBsYvrhSHqKP2pMiaMMKPPyqNtSALPjnnoB9EyzzveQ/0?wx_fmt=jpeg" style="height:auto !important;" alt="image" /><br />
</span><span style="font-family:宋体;">英国品牌“</span>BEMEGA<span style="font-family:宋体;">”保温杯，远销欧美，日韩。产品款式新颖，质量过硬，深受消费者喜欢。生产厂家</span>长期为日本一线品牌贴牌生产<span style="font-family:宋体;">。生产厂家主攻外贸，在国内只销售有限的几款产品。而我们签订合约后，将在绍兴地区把更多，更新的深受日韩市场喜爱的产品不断奉献给消费者。我们经过了很多努力，并最终拿到绍兴地区的总代理。</span><span style="font-family:宋体;"><img src="https://mmbiz.qlogo.cn/mmbiz/gr7NDcVyoDGDdImldfnM9GZFD7fGOCBZVkwibWCf8mmog2c7pkljALWqrq0afb6cbMWDiciaT2FNjxcGLm2xGBBoQ/0?wx_fmt=jpeg" style="height:auto !important;" alt="image" /><br />
<span style="font-family:simsun;">.</span></span>
</p>
<p style="font-family:sans-serif;font-size:16px;text-indent:32px;">
	<span style="color:#FF0000;"><strong><span style="font-family:宋体;">【礼杯</span><span style="font-family:Calibri;">-</span><span style="font-family:宋体;">特色业务】</span></strong></span><span style="font-family:宋体;">十年专业设计，为企业量身定制！</span>
</p>
<p style="font-family:sans-serif;font-size:16px;text-indent:32px;">
	<span style="font-family:宋体;">我们将以礼杯定制为特色业务。集产品设计、包装为一体，着重突出“礼”杯。</span><span style="font-family:宋体;"><img src="https://mmbiz.qlogo.cn/mmbiz/gr7NDcVyoDHwTOjrhCXwLia6LQxbuJ4ibgmiaUgKRG0rPyiaPvjqN3JosDIWcAGwibTcDZjj8V08FtW9UwLaADJt8Rw/0?wx_fmt=jpeg" style="height:auto !important;" alt="image" /><br />
&nbsp;</span><span style="font-family:宋体;">未来将专注开发一系列包装，款式符合年轻消费群的保温杯、水杯、马克杯等适合送礼的产品。</span>
